 */
const checkFileExistsWithExtensions = (
	fsService: {
		fileExists: (path: string) => Effect.Effect<boolean, FilesystemError>;
	},
	pathGenerator: (ext: string) => string,
): Effect.Effect<boolean, FilesystemError> =>
	Effect.gen(function* (_) {
